import React from 'react'
import HistoryItem from "./HistoryItem";


const HistoryList = ({history}) => {
    return(
        <div>
            <h1>History</h1>
            <p>{history.x}</p>
            <p>{history.operation}</p>
            <p>{history.y}</p>
            <p>=</p>
            <p>{history.result}</p>
            {/*{history.map(i => <HistoryItem item={i}/>)}*/}
        </div>
    )
}
export default HistoryList
